const Cart = (props)=>{
    

    return(
        <>
            {props.cartItems.map(item => (<div id={item.id}>
                <img src={item.srcs}></img>
                <p>{item.name}</p>
                <p>{item.price}</p>
                <p>{item.off}</p>
                <p>{item.size}</p>
            </div>))}
        </>
    )

}
export default Cart;
